import React from 'react';


const Homepage = () => {
    return (
        <div className='homepage-container'>
            <div>
                <input type="email" placeholder='Enter your email'/>
                <input type="text" placeholder='Enter room code'/>
                <button>Submit</button>
            </div>
        </div>
    )
}
